import React from "react";
import "./OurPartners.css";
// import radioLogo from "../assets/partners/radio.png"; // replace with actual logo
import venueLogo from "../assets/logo/venue_partner.jpeg"; // replace with actual logo
import otherLogo from "../assets/partners/other.png"; // replace with actual logo

const OurPartners = () => {
  const partners = [
    { name: "Radio FM Partner", logo: venueLogo },//change karvu
    { name: "Venue Partner", logo: venueLogo },
    { name: "Digital Media Partner", logo: venueLogo },//change krvu
    { name: "Leasing Partner", logo: venueLogo },// change karvu
  ];

  return (
    <section className="partners-section">
      <div className="partners-container">
        <h2 className="partners-title">Our Partners</h2>
        <p className="partners-subtitle">
          Weâ€™re proud to collaborate with leading brands who make this event possible.
        </p>

        <div className="partners-grid">
          {partners.map((partner, index) => (
            <div className="partner-card" key={index}>
              <div className="partner-logo">
                <img src={partner.logo} alt={partner.name} />
              </div>
              <h3 className="partner-name">{partner.name}</h3>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
};

export default OurPartners;
